        $keys: index-to-key($breakpoints, $i);
        @include from(map-get($breakpoints, $keys)) {
          @at-root .#{$keys}\:#{$nombre} {
            // @at-root .#{$keys}\>#{$nombre} {
            @content;
          }
          @if length($names) > 1 {
            @for $i from 2 through length($names) {
