    @include from($xl) {
      max-width: 1024px;
    }
  }
}

//----------------------------------------------------
._screen_size {
  // position: relative;
  &::before {
    content: "tinny";
    position: fixed;
    top: 0;
    left: 0;
    background-color: $gray-dark;
    color: $white;
    z-index: 1000;
    padding: 3px 5px;
    border: $white 1px dotted;
    opacity: 0.7;

    $indes: $z-modal_1000 + 2;

    // @each $key, $value in $breakpoints {
    //   @include from($value) {
    //     content: "+#{$value}";
    //     font-size: ($font-size * $indes) / 2;
    //   }
    //   $indes: $indes + 1;
    // }

    @for $value from 1 to 30 {
      @include from($value * 50px) {
        content: "#{$value * 50}px";
        // font-size: ($font-size * $indes) / 9;
      }
      $indes: $indes + 1;
    }
  }
}
// resize
._resize {
  resize: both;
  overflow: auto;
  &-h {
    resize: horizontal;
    overflow: auto;
  }
  &-v {
    resize: vertical;
    overflow: auto;
  }
}

